BLACK BEAN AND PLANTAIN NOURISH BOWLüå±üå±

Lunch was a very simple but flavorful Cuban inspired vegan bowl filled with black beans, brown rice, kale salad, pan fried plantains, avocado, and lime wedges. 

*black beans we‚Äôre made in the instant pot with red bell pepper, red onions, garlic, and spices. 

Ingredients -
1 cup dry black beans (rinsed and soaked overnight)
1 red bell pepper, diced
1/4 red onion, diced
3 garlic cloves, diced
1 tsp cumin
1 tsp oregano
1 tsp salt
1 Bay leave
2 cups of water

Add all the ingredients to the instant pot.  Mix until well combined.  Pressure cook on manual setting for 30 minutes.  Natural release for 15 minutes.  Once its cooked, taste for salt.  At this time you can remove some of the liquid if you would like.  Just remember, as it cools it will thicken up even more.
Enjoy!!

